description:
                                    Описание от продавца                            
Продаю 2-комнатную квартиру в элитном жилом комплексе премиум класса во французском стиле «Гранвиль». Строительная компания «Имарат Строй». Жилкомплекс находится на пересечении улиц Орозбекова и Чуйкова, между улицами Боконбаева и Линейной (Туголбай-Ата). Сдан под самоотделку (уже можно начинать ремонт), сдача в эксплуатацию декабрь 2020г.

Количество этажей: 14. Квартира на 6 этаже. Площадь 78,74 м2. Количество подъездов: 2.

Материалы: железобетонный каркас, заполнение — кирпич. Отделка фасада: натуральный камень — сары таш.

Квартиры оснащены:

· Центральным отоплением;
· Природным газом;
· Горячим и холодным водоснабжением;
· Алюминиевые панорамные витражи;
· Домофонами;
· Бесшумными скоростными лифтами;
· Кабельным телевидением;
· Высокоскоростным интернетом в каждой квартире.
Жилой дом также включает:

· Удобно спланированный внутренний двор с гостевой автостоянкой;
· Подземный паркинг;
· Вестибюль, консьерж-службу;
· Импортную детскую игровую площадку;
· 3-х уровневую систему безопасности.

Цена квартиры 75 000 долларов США - торг уместен.

Просьба звонить по телефону: 0 550 235 003

