                                    Описание от продавца                            
Продаются две 1-комнатные квартиры в ЖК Асанбай Ордо (Итальянский квартал) - Токомбаева-Сухэ Батора, за парком Асанбай.

На 3 этаже (51,5 м2) и на 4 этаже (46,2 м2) в 1-м блоке. Сдача под самоотделку сентябрь-октябрь 2020 года.

Высота потолков 3 метра. Квартиры с лоджиями.

Стоимость 1 м2 = 800 долларов США. № телефона 0 550 880 035

Асанбай Ордо - это жилой комплекс комфорт-класса с характеристиками жилья премиум-класса.

В доме с фасадом из травертина есть высокие потолки, просторные окна, террасы и роскошные виды на горы.

В шаговой доступности находятся: парк Асанбай; гипермаркет Глобус; супермаркет "Народный" и т.п.

Центральные коммуникации: водоснабжение, отопление, газоснабжение, канализация.

Дополнительные особенности ЖК:
охраняемая территория;
беговая дорожка;
мини-футбольное поле;
спортивная зона;
благоустроенный двор;
детская площадка с резиновым покрытием.

