Строительная компания Имарат Строй
Строительная компания «Имарат Строй» была создана в 1996 году. За двадцать пять лет деятельности на строительном рынке Кыргызстана, компания сумела завоевать известность, приобрести авторитет как у коллег, так и у заказчиков, благодаря своей ответственности и профессионализму. На сегодняшний день, Строительная компания Имарат Строй имеет лицензию серии КРЦ-1—2 № 03082 I уровня ответственности от 10 декабря 2009 года.
Основателем строительной компании «Имарат Строй» является Заслуженный строитель КР с 40 летним стажем работы в области строительства Иманалиев Бейшенбек Султанович.
Наша компания занимается оказанием следующих видов услуг:
•	Проектирование любых объектов II уровня;
•	Капитальное строительство зданий и сооружений “под ключ” I уровня;
•	Монтаж метало — и железобетонных конструкций;
•	Прокладка внутренних и наружных инженерных сетей (водоснабжение, канализация и электроснабжение от 0,4 до 10 кВ);
•	Монтаж системы отопления;
•	Ремонтно-отделочные работы любой сложности;
•	Поставка оборудования и строительных материалов от лучших производителей дальнего и ближнего зарубежья;
•	По согласованию с партнером составление смет, документаций и проектов сооружений в соответствии со строительными нормами и правилами (СНиП);
•	Предоставление услуг по аренде грузовой строительной техники и др.
